import React from "react";
import "../imagesContainer/image.css";
import bulma from "../../../public/images/bulma.png";
import chichi from "../../../public/images/chichi.png";
import frieza from "../../../public/images/frieza.png";
import gogeta from "../../../public/images/gogeta.png";
import grandkai from "../../../public/images/grandkai.png";
import kingkai from "../../../public/images/kingkai.png";
import mrsatan from "../../../public/images/mrsatan.png";
import shenron from "../../../public/images/shenron.png";
import southkai from "../../../public/images/southkai.png";

const images = [{
    photo: { bulma },
    text: "Bulma"
},
{
    photo: { chichi },
    text: "Chi-Chi"
},
{
    photo: { frieza },
    text: "Frieza"
},
{
    photo: { gogeta },
    text: "Gogeta"
},
{
    photo: { grandkai },
    text: "Grand Kai"
},
{
    photo: { kingkai },
    text: "King Kai"
},
{
    photo: { mrsatan },
    text: "Mr. Satan"
},
{
    photo: { shenron },
    text: "Shenron"
},
{
    photo: { southkai },
    text: " South Kai"
}];

export default images;
